function getFixedStepsFormat(b) {
    var e = [];
    for (var d = 0; d < b.length; d++) {
        var f = b[d];
        if (f.isInterimStep) {
            e.push(f)
        } else {
            if (f.steps != null && f.steps.length > 1) {
                for (var c = 0; c < f.steps.length; c++) {
                    var a = f.steps[c];
                    e.push(a)
                }
                if (f.entire_result) {
                    e.push({
                        entire_result: f.entire_result
                    })
                }
            } else {
                e.push(f)
            }
        }
    }
    return e
}

